The mission of Xxxxxxxx Xxxxxxxx Xxxxxxxx xx Xxxxxxxxxxxx XX is to increase awareness of domestic violence and its effect on the community, to empower those victimized by providing advocacy and safe and effective services, and to work for social change designed to eliminate domestic violence.

Xxxxxxxx Xxxxxxxx Xxxxxxxx xx Xxxxxxxxxxxx XX is committed to providing services to individuals and their children who are abused or threatened with abuse. DVSSP is a safe, non-judgmental alternative to domestic violence. We are working toward making the community aware of the scope of domestic violence and its impact on individuals, the family, and society.

We offer:
•Safe, temporary shelter;
•24 hour hotline;
•24 hour transportation and intake;
•Empowerment counseling and support groups for residents and non-residents;
•Information and referrals;
•Advocacy;
•Accompaniment;
•Legal advocacy program;
•Transitional housing;
•Children's program;
•Food, clothing, and personal care items for residents;
•Domestic violence prevention projects in schools;
•Community education and training programs.

Serving Washington, Greene, and Fayette counties in Pennsylvania.
•In Washington County, call 724-223-9190 or 800-791-4000
•In Greene County, call 724-852-2463
•In Fayette County, call 724-439-9500

24-Hours a Day, 7-Days a Week!
